pragma solidity ^0.8.0;

contract HospitalContract {
    struct ContractData {
        string hospitalName;
        string services;
        uint256 salary;
        uint256 startDate;
        uint256 duration;
        uint256 noticePeriod;
    }

    ContractData[] public contracts;

    function createContract(
        string memory _hospitalName,
        string memory _services,
        uint256 _salary,
        uint256 _startDate,
        uint256 _duration,
        uint256 _noticePeriod
    ) public {
        ContractData memory newContract = ContractData(
            _hospitalName,
            _services,
            _salary,
            _startDate,
            _duration,
            _noticePeriod
        );
        contracts.push(newContract);
    }
}
